(17, 'Hookas & Paan', 0, '<p><img src=\"https://urgenthai.in/storage/stock-photo-indian-traditional-mouth-freshener-sweet-paan-also-known-masala-paan.jpg\" alt=\"stock-photo-indian-traditional-mouth-freshener-sweet-paan-also-known-masala-paan\" loading=\"lazy\"><br>&nbsp;<strong>Paan:</strong></p><p><i>Paan</i> is a traditional Indian after-dinner treat that consists of a betel leaf (Piper betle) filled with chopped areca nut (Areca catechu), slaked lime (chuna), and various other ingredients such as red katha paste. It is commonly chewed as a palate cleanser and breath freshener, and it holds cultural significance in many South Asian communities.</p>', 'published', 14, 'oip.jpg', 1, '2025-01-22 17:10:22', '2025-01-27 14:40:54', 'fi-rs-alarm-clock', 'oip.jpg');
