(56, 6, 20, 4.00, 'Perfect +++++++++ i love it really also i get to fast ticket answers... Thanks Lot BOTBLE Teams', 'published', '2024-02-24 01:32:36', '2024-02-24 01:32:36', '[\"products\\/10-1.jpg\",\"products\\/14.jpg\",\"products\\/16-4.jpg\"]'),
