(7, 'About us', '<h2>About Us</h2><p>Welcome to Urgenthai, your go-to platform for quick and reliable delivery services! Whether you\'re craving your favorite meal, need groceries delivered to your doorstep, or require a quick courier service, Urgenthai is here to make your life easier.</p><p><strong>Our Mission</strong></p><p>At Urgenthai, our mission is to connect vendors, customers, and riders in a seamless and efficient manner. We strive to provide a platform where local businesses can thrive, customers can enjoy convenience, and riders can find rewarding opportunities.</p><p><strong>What We Offer</strong></p><p>• &nbsp;For Vendors: Urgenthai offers a robust platform for local businesses to reach a wider audience. Whether you run a restaurant, grocery store, or any other local business, we provide the tools you need to manage orders, track deliveries, and grow your customer base.</p><p>• &nbsp;For Customers: Enjoy the convenience of having your favorite products delivered right to your doorstep. With a wide range of vendors to choose from, you can find everything you need in one place. Our user-friendly app makes ordering quick and easy.</p><p>• &nbsp;For Riders: Join our team of dedicated riders and enjoy flexible working hours, competitive earnings, and the satisfaction of delivering smiles to our customers. We value our riders and provide the support they need to succeed.</p><p><strong>Why Choose Us?</strong></p><p>• &nbsp;Reliability: We pride ourselves on timely and accurate deliveries. Our advanced tracking system ensures you know exactly when your order will arrive.</p><p>• &nbsp;Variety: From food to groceries to courier services, Urgenthai offers a wide range of options to meet your needs.</p><p>• &nbsp;Community: We believe in supporting local businesses and creating opportunities for everyone in our community.</p><p><strong>Join Us Today!</strong></p><p>Whether you\'re a vendor looking to expand your reach, a customer seeking convenience, or a rider wanting to join a dynamic team, Urgenthai is the place for you. Join us today and experience the difference!</p>', 1, NULL, 'default', '', 'published', '2024-02-24 01:32:41', '2025-01-15 12:40:06'),
(8, 'Cookie Policy', '<h3>EU Cookie Consent</h3><p>To use this website we are using Cookies and collecting some data. To be compliant with the EU GDPR we give you to choose if you allow us to use certain Cookies and to collect some Data.</p><h4>Essential Data</h4><p>The Essential Data is needed to run the Site you are visiting technically. You can not deactivate them.</p><p>- Session Cookie: PHP uses a Cookie to identify user sessions. Without this Cookie the Website is not working.</p><p>- XSRF-Token Cookie: Laravel automatically generates a CSRF \"token\" for each active user session managed by the application. This token is used to verify that the authenticated user is the one actually making the requests to the application.</p>', 1, NULL, 'default', NULL, 'published', '2024-02-24 01:32:41', '2024-02-24 01:32:41'),
